import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({getquestionid, questions, id, upVote, index}) {

    const question = getquestionid(parseInt(id));
    console.log(question);

    return(
        <Paper>
            <h1>Title: {question.title}</h1>
            <p>Question: {question.subtitle}</p>
            <p>Category: {question.category}</p>
            <p onClick={() => upVote(index)}>{question.upVote}</p>
        </Paper>
    )
}

export default Question;
